import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import Welcome from './welcome';
import Skills from './skills';
import './navbarStyle.css'
class NavBar extends Component {
    state = {}
    render() {
        return ( 
    <div>

    <nav className="navbar navbar-expand-lg navbar-light bg-dark">
    
  <font   className="navbar-brand text-danger" href="#">Navbar</font>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="navbarNav">
    <ul className="navbar-nav float-start">
      <li className="nav-item">
      <NavLink className="nav-link text-warning" to = { '/home' } Component={<Welcome/>}> Home <span className="sr-only">(current)</span> </NavLink>  
      </li>
      <li className="nav-item ">
      <NavLink className="nav-link text-warning" path = { "/skils" } Component={<Skills/>}> Skils </NavLink>  
      </li>
      <li className="nav-item">
      <NavLink  className="nav-link text-warning" path = { "/contactUs" } > Contact Us </NavLink>  
      </li>
    </ul>
  </div>
</nav>

           
            </div>




        );
    }
}

export default NavBar;
